import React, { useEffect } from "react";
import "./jquery.lightroom.css";
import "./bootstrap.min.css";
import "./Hero.css"

function Hero() {
  const images = [
    "imgs/1.png",
    "imgs/1.png",
    "imgs/1.png",
    "imgs/1.png",
    "imgs/1.png",
    "imgs/1.png",
    "imgs/1.png",
    "imgs/1.png",
    "imgs/1.png",
    "imgs/1.png",
  ];

  useEffect(() => {
    $("#jLightroom")
      .lightroom({
        image_container_selector: ".jlr_item",
        img_selector: "img.jlr_img",
        img_class_loaded: "jlr_loaded",
        img_space: 5,
        img_mode: "min",
        init_callback: function (elem) {
          $(elem).removeClass("gray_out");
        },
      })
      .init();
  }, []);

  return (
    <div className="container">
      <h1 className="display-2 text-dark p-3">Responsive image gallery</h1>
      <div id="jLightroom" className="jlr">
        {images.map((image, index) => (
          <a href={image} data-lightbox="lb1" className="jlr_item" key={index}>
            <img src={image} className="jlr_img" />
          </a>
        ))}
      </div>
    </div>
  );
}
